kills.\r\nGood knowledge in database testing & concepts.\r\nCan work independently, lead or work within a team environment.\r\nAbility to quickly gain an understanding of client’s business and applications.\r\nCapable of working at great pressures and tight deadlines.\r\n\r\n\r\nAcademic Background...…………………………………………………….\r\n\r\nMaster of Computer Applications (M.C.A) from Osmania University, Hyderabad.\r\n\r\nExperience Details…………………………………………………………...\r\n\r\nWorking as a Software Test Engineer with Verinon Technology Solutions Pvt Ltd, Hyderabad, from Feb 2016 To Till Date.\r\n\r\nWorked as a Software Test Engineer with Response Informatics Pvt. Ltd, Hyd, from Sep 2013 to Dec 2015.\r\n\r\n\r\nTechnical Skills………………………………………………………………\r\n\r\nSoftware Testing\r\nManual Testing & Automation Testing\r\nAutomation Tools\r\nLoad Runner, QC\r\nRDBMS\r\nOracle 9i, SQL\r\nScripting Language\r\nVB Script\r\nOperating Systems\r\nWindows 98/NT/2000/XP\r\n\r\n\r\nProjects Executed……………………………………………………………\r\n\r\nProject # 1\r\nTitle\r\nRetail Management System (RMS)\r\nClient\r\nNucon Zander\r\nEnvironment\r\nJ2EE, XML, Swing, Oracle 9i\r\nTesting Tools\r\nManual, QC\r\nPeriod\r\nDec 2017 to Till Date\r\n\r\nDescription: Retail Management System (RMS) comprehensively covers all the aspects of the organization like raising an indent order for procuring raw material from the vendor, checking for the ordered material and inspection for the damaged material. Manufacturing the products with the raw material and selling them to the customers basing on the purchase order raised by them.\r\n\r\nResponsibilities:\r\n\r\nStudy and analysis of the Business Requirements.\r\nCreated and executed test cases.\r\nParticipated in bug-review meetings.\r\nInteract closely with user to understand the requirements.\r\nCreated defect report and discussed with the team members about the defects.\r\nDocumentation of the test results.\r\n\r\nProject # 2\r\nTitle\r\nMetlife\r\nClient\r\nMetlife India Insurance Co., \r\nEnvironment\r\n.Net, Oracle 9i\r\nTesting Tools\r\nManual, QC\r\nPeriod\r\nNov 2016 to Sep 2017\r\n\r\nDescription: This System aimed to cater to the needs of the Insurance sector. It is a web-based product with a comprehensive illustration system, sales tool kit with downloadable feature, back office module, premium calculator and an application to control and maintain the Financial Advisors (also known as agents) information. This system aims in sales promotion and generates illustrated reports based on the data collected from the customer.\r\n\r\nResponsibilities:\r\n\r\nAnalyzed user requirements and developed test cases.\r\nCreated Test Scenarios and executed them.\r\nCreated defect report and discussed with the team members about the defects\r\nWorked closely with user to understand the requirements.\r\nParticipated in weekly team meetings for tracking the progress of project.\r\nDocumentation of the test results.\r\n\r\n\r\n\r\nProject # 3\r\nTitle\r\nClin Aid Healthcare System\r\nClient\r\nBAPCO Hospital \r\nEnvironment\r\nJSP, EJB, Swing, XML, Servlets, Oracle 9i\r\nTesting Tools\r\nManual, LR, QC\r\nPeriod\r\nFeb 2016 to Sep 2016\r\n\r\nDescription: This project is being developed on total automation of Hospital Management. This package is for their health care center, which takes care of the various aspects of Hospital Management like Billing, Lab, Discharge, Appointment, payroll, registration etc., \r\n\r\nResponsibilities:\r\n\r\nUnderstanding the Requirements Specification.\r\nActive participation in weekly meetings.\r\nCreated defect report and discussed with the team members about the defects.\r\nPreparation of Documents.\r\nInvolved in weekly meetings for tracking the progress of project.\r\nWorked closely with user to understand the requirements.\r\n\r\n\r\nProject # 4\r\nTitle\r\nCeltiCare \r\nClient\r\nCeltic Insurance Co.\r\nEnvironment\r\nJava, JSP, EJB, Oracle 9i\r\nTesting Tools\r\nManual, LR, QC\r\nPeriod\r\nApr 2015 to Dec 20